import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";

export const TopItem = ({ setSelected }) => {
  const [theme, setTheme] = useContext(ThemeContext);
  const Sampledata = [
    {
      id: 1,
      name: "Johny Bravo",
      type: "Global",
    },
    {
      id: 2,
      name: "Johny Maskulado",
      type: "Player",
    },
    {
      id: 3,
      name: "Johny Brave",
      type: "Global",
    },
  ];

  return (
    <div
      className={`flex col-span-8 overflow-hidden rounded-lg shadow-lg  text-xs md:text-md w-64 px-8 sm:w-full py-10 mb-5 ${
        theme === "night" ? "bg-night  text-white " : "bg-fantasy text-black"
      }`}
    >
      <div className="flex flex-col items-center justify-center h-screen">
        <table className="border-collapse border border-gray-800">
          <thead>
            <tr>
              <th className="border border-gray-800 p-2">Items</th>
              <th className="border border-gray-800 p-2">Sold</th>
            </tr>
          </thead>
          <tbody>
            {[...Array(6)].map((_, index) => (
              <tr key={index}>
                <td className="border border-gray-800 p-2">Item {index + 1}</td>
                <td className="border border-gray-800 p-2">
                  {Math.floor(Math.random() * 10)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};
export default TopItem;
